import { Hypertext as BaseHypertext, } from "@microsoft/fast-components-react-base";
import hypertextSchema from "./hypertext.schema";
import manageJss from "@microsoft/fast-jss-manager-react";
import { HypertextStyles } from "@microsoft/fast-components-styles-msft";
/*
 * The type returned by manageJss type is very complicated so we'll let the
 * compiler infer the type instead of re-declaring just for the package export
 */
/* tslint:disable-next-line:typedef */
const Hypertext = manageJss(HypertextStyles)(BaseHypertext);
export { Hypertext, hypertextSchema, };
